scheduler.templates.timeline_scale_label = function (key, label, section) {
  const imgSrc = "https://www.svgrepo.com/show/57853/avatar.svg";
  return [
    "<div class='timeline_item_cell'>" +
      `<img class='redactor-image' src='${imgSrc}'/>` +
      `<div class='redactor-info-wrapper'>` +
      `<span class='redactor-name'>${section.label}</span>` +
      `<span>${section.number}</span>` +
      `<span>${section.description} / ${section.employment_type}</span>` +
      `</div>` +
      "</div>",
    "<div class='timeline_item_cell room_status'>",
    "<span class='status-label'>" +
      scheduler.getRedactorByKey(key).end_time +
      "</span>",
    "</div>",
  ].join("");
};

